window.bookSummaryJSON = "<p><b>Multiplying foes. A deadly city. And with no clear path to his goals, how will Michael survive Nexus?</b></p> <p>Michael reaches Nexus, but finds advancing more challenging than he’d anticipated. Factions abound, allegiances shift, and separating truth from lies is harder than ever.</p> <p><b>The line between friend and foe blurs, and Michael’s path grows murkier.</b></p> <p>Nexus is a place of both opportunity and danger. Sitting at the heart of the world, the city is home to thousands—ordinary people, players, but Powers too. Can Michael remain free of their clutches, or will he become entangled in the Powers’ machinations?</p> <p><b>Will Nexus be the death of Michael?</b></p> <p>Follow Michael on his epic journey and find out!</p>"; 
